function convertLongiLatituJsonToArr(data) {
    let arr = data.map(item => {
        // 解析 JSON 字符串
        const coordinates = JSON.parse(item.longiLatituJson);
        // 转换为所需格式
        return coordinates.map(coord => ({
            longitude: coord[0],
            latitude: coord[1]
        }));
    });
    return arr;
}

